import React from 'react';

import "../../style/projectTitle.css";


const ProjecTitle = (props) => (
    <>
        <div>
            <div>
                <h1 className = {"h1-font-settings company-regular-" + props.mode}>{props.company}</h1>

                <h2 className = {"h2-font-settings projectName-regular-" + props.mode}>{props.projectName}</h2>

                <h3 className = {"h3-font-settings projectDescription-regular-" + props.mode}>{props.projectDescription}</h3>

                <img src = {props.tag1} className = "tag" id = "tag-1-regular"></img>
                <img src = {props.tag2} className = "tag" id ="tag-2-regular"></img>
                <img src = {props.tag3} className = "tag" id ="tag-3-regular"></img>
                <img src = {props.tag4} className = "tag" id ="tag-4-regular"></img>
                <img src = {props.tag5} className = "tag" id ="tag-5-regular"></img>
                <img src = {props.tag6} className = "tag" id ="tag-6-regular"></img>
            </div>
        
            <img src = {props.projectImage} className = "projectImage"></img>
            </div>
        {/* differentiate regular vs mobile in classes and light vs*/}
    </>
);

export default ProjecTitle;
